  ?parent dbo:parent <http://dbpedia.org/resource/John_Quincy_Adams> .
  ?parent a dbo:Politician ;
          foaf:nationality <http://dbpedia.org/resource/United_States> .

  # Part 2: Find the residence of this professional, which is a settlement
  OPTIONAL {
    ?parent dbo:residence ?residence .
    ?residence a dbo:Settlement .

    # Part 3: Identify the person who died at this residence
    ?deathEvent dbo:place ?residence ;
                dbo:agent ?decedentAtResidence .
  }

  # Part 4: Find any person who died in Massachusetts
  OPTIONAL {
    ?deathEventInMassachusetts dbo:place <http://dbpedia.org/resource/Massachusetts> ;
                               dbo:agent ?decedentInMassachusetts .
  }
}
```

