```sparql
SELECT ?militaryForceOfTamai ?commanderInWar
WHERE {
  # Part 1: Find the military force of Battle of Tamai
  <http://dbpedia.org/resource/Battle_of_Tamai> dbo:militaryForce ?militaryForceOfTamai .

  # Part 2a: Identify the reference to 'A' Battery, Royal Australian Artillery
  ?reference a dbo:MilitaryUnit ;
             dbo:country <http://dbpedia.org/resource/Australia> ;
             rdfs:label "'A' Battery, Royal Australian Artillery"@en .

  # Part 2b: Find the war associated with this reference
  ?war dbo:eventParticipant ?reference ;
       a dbo:SocietalEvent, dbo:MilitaryConflict .

  # Part 3: Find the commander in that war
  ?war dbo:commander ?commanderInWar .
}
```

